import './App.css';
import { Forecaster } from './componentes/forecaster';
import { Location } from './componentes/location';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Location />
        <Forecaster />
      </header>
    </div>
  );
}

export default App;
